import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import store from './store/store'

Vue.directive("tooltip", (el, binding) => {
    $(el).tooltip({
        title: binding.value,
        placement: binding.arg,
        trigger: "hover",
    });
});

const app = createApp(App);

app.use(router);
app.use(store);
app.mount('#app');
